### `useEffect` Hook Overview

The `useEffect` hook in React is used to perform side effects in function components. Side effects can include data fetching, subscriptions, or manually changing the DOM in React components. `useEffect` runs after the component renders, and you can control when it runs by specifying dependencies.

### Basic Syntax

```jsx
useEffect(() => {
  // Your side effect logic here

  return () => {
    // Cleanup logic here
  };
}, [dependencies]);
```

### Dependencies

- **Dependencies Array**: The second argument to `useEffect` is an array of dependencies. The effect will only re-run if one of the dependencies has changed since the last render.
- **Empty Array**: If you pass an empty array (`[]`), the effect will run only once after the initial render, similar to `componentDidMount` in class components.
- **No Array**: If you omit the array, the effect will run after every render, which can lead to performance issues if not managed carefully.

